33\u0430\u0435\u0442 \u0441\u043a\u043e\u0440\u043e\u0442\u0430\u0442\u044c \u0432\u0440\u0435\u043c\u044f \u0432 \u043f\u0440\u043e\u0431\u043a\u0430\u0445.\n\u041a\u0430\u0437\u0430\u043b\u043e\u0441\u044c \u0431\u044b \u0438\u0433\u0440\u0443\u0448\u043a\u0430 \u0441 \u043f\u0440\u043e\u0441\u0442\u044b\u043c \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043e\u043c ,\u0430 \u0443\u0432\u043b\u0435\u043a\u0430\u0435\u0442 \u0442\u0430\u043a\u0438 \u043d\u0430 \u0434\u043e\u043b\u0433\u043e.","image_url":"http:\/\/hand-spinner.com.ua\/wp-content\/uploads\/2017\/03\/1_review.jpg","title":"\u0412\u0430\u0434\u0438\u043c \u0412\u043b\u0430\u0441\u043e\u0432","subtitle":"\u041d\u0430 5 \u0441 \u043f\u043b\u044e\u0441\u043e\u043c","id":"","shortcode":"undefined"},{"text":"\u041e\u0447\u0435\u043d\u044c \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u0430 \u044d\u0442\u043e\u0439 \u043f\u043e\u043a\u0443\u043f\u043a\u043e\u0439. \u0418\u0433\u0440\u0443\u0448\u043a\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0443\u0432\u043b\u0435\u043a\u0430\u0435\u0442 \u0438 \u0443\u0441\u043f\u043e\u043a\u0430\u0435\u0432\u0430\u0435\u0442. \u0412\u0441\u0435\u0433\u0434\u0430 \u0438\u0441\u043a\u0430\u043b\u0430 \u0447\u0442\u043e-\u0442\u043e \u043f\u043e\u0434\u043e\u0431\u043d\u043e\u0435 ,\u0442\u0430\u043a \u043a\u0430\u043a \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u044f \u043e\u0447\u0435\u043d\u044c \u043d\u0435\u0440\u0432\u043d\u044b\u0439,\u0442\u043e \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e \u043a\u0440\u0443\u0447\u0443 \u0432 \u0440\u0443\u043a\u0430\u0445 \u0440\u0430\u0437\u043d\u044b\u0435 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u044b,\u0431\u0443\u0434\u044c \u0442\u043e \u0440\u0443\u0447\u043a\u0430 \u0438\u043b\u0438 \u043a\u043e\u043b\u044c\u0446\u043e .\u0421 \u043f\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u0435\u043c Hand Spinner \u044d\u0442\u043e\u0442 \u043f\u0440\u043e\u0446\u0435\